import React from "react";

const url = "https://image.tmdb.org/t/p/w500/A0knvX7rlwTyZSKj8H5NiARb45.jpg";

export const Card_Movie = ({
  title,
  release_date,
  vote_average,
  poster_path,
}) => {
  console.log(title);
  console.log(release_date);
  console.log(vote_average);
  console.log(poster_path);
  return (
    <div className="container w-48 overflow-hidden mx-5">
      <div>
        <img
          src={url}
          alt="asd"
          className="rounded-lg cursor-pointer shadow-lg"
        />
      </div>

      <div className="p-2">
        <h1 className="">Title</h1>
        <p className="">15/5/2012</p>
        <p className="">72%</p>
      </div>
    </div>
  );
};

export default Card_Movie;
